import React from "react";
import "../checkout/checkout.styles.scss";

const CheckOut = () => {
  return (
    <div>
      <div className="line-descriptions">
        <span>Product</span>
        <span>Description</span>
        <span>Quantity</span>
        <span>Price</span>
        <span>Revmove</span>
        <hr />
      </div>
    </div>
  );
};

export default CheckOut;
